(13,'Registrasi Student Day 2019 Mahasiswa Lama','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi mahasiswa lama Fakultas Teknik Universitas Udayana yang <strong>BELUM MENGIKUTI</strong> dan <strong>LULUS BERSYARAT </strong>Student Day tingkat fakultas dapat melakukan registrasi dengan ketentuan yang telah tertera pada pamflet. Daftar mahasiswa lama yang belum mengikuti dan lulus bersyarat Student Day dapat dilihat pada link berikut:</p>\r\n\r\n<p><a target=\"_blank\" href=\"https://drive.google.com/file/d/1DKhVsUXWnjmhLxPLty5jFM2ARTDxkgmz/view\">Data Mahasiswa Lama, <strong>Belum Mengikuti</strong> dan atau <strong>Lulus Bersyarat</strong></a></p>\r\n\r\n<p>Nb : bagi Lulus Bersyarat diharapkan menunjukkan bukti bahwa telah memenuhi syarat. jika tidak, dianggap Tidak Lulus.</p>\r\n\r\n<p>#HIDUPTEKNIK !!!</p>\r\n','1557984201.jpg','2019-05-16 05:20:55','2019-06-29 02:58:07',1),
(14,'Registrasi dan Registrasi Online','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Fakultas Teknik Universitas Udayana jalur SNMPTN dan SBMPTN dapat melakukan registrasi online dan registrasi Student Day tingkat fakultas dengan ketentuan yang telah tertera pada pamflet. Dan berikut merupakan Denah :</p>\r\n\r\n<p><img alt=\"\" src=\"/thumbnail/Pengumuman denah.jpg\" style=\"height:auto; width:70%\" /></p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1561695692.jpg','2019-06-28 04:21:32','2019-06-29 02:59:15',1),
(15,'PETUNJUK PENGISIAN DATA REGISTRASI ONLINE ','<p>[ PETUNJUK PENGISIAN DATA REGISTRASI ONLINE ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Fakultas Teknik Universitas Udayana jalur SNMPTN dan SBMPTN dapat melakukan registrasi online melalui web <a target=\"_blank\" href=\"https://orientasi.unud.ac.id\">orientasi.unud.ac.id</a></p>\r\n\r\n<p>Mahasiswa Baru yang terdaftar di Student Day Universitas sudah langsung terdaftar pada Student Day Fakultas Teknik. Petunjuk mengenai pengisian data Registrasi Online Student Day 2019 telah tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1561698709.jpg','2019-06-28 05:11:50','2019-06-29 03:01:26',1),
(16,'REGISTRASI MAHASISWA BARU JALUR SNMPTN & SBMPTN','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Jalur SNMPTN dan SBMPTN Fakultas Teknik Universitas Udayana dapat melakukan Registrasi Student Day tingkat Fakultas bertempat di Parkir LPPM Lama Rektorat Universitas Udayana sesuai dengan waktu dan ketentuan yang tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1563525273.jpg','2019-07-19 08:34:33','2019-07-19 08:34:33',1),
(17,'REGISTRASI STUDENT DAY 2019 MAHASISWA LAMA','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Lama Fakultas Teknik Universitas Udayana yang belum melakukan Registrasi Student Day tingkat Fakultas dapat melakukan Registrasi yang bertempat di Parkir LPPM Lama Rektorat Universitas Udayana sesuai dengan ketentuan yang tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1563525365.jpg','2019-07-19 08:36:05','2019-07-19 08:36:05',1),
(18,'ALUR PENDAFTARAN MAHASISWA LAMA','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Informasi mengenai alur pendaftaran peserta Student Day 2019 Fakultas Teknik Universitas Udayana untuk mahasiswa lama&nbsp;dapat dilihat selengkapnya pada pamflet.&nbsp;</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1563525468.jpg','2019-07-19 08:37:48','2019-07-19 08:39:38',1),
(19,'ALUR PENDAFTARAN MAHASISWA BARU JALUR SNMPTN & SBMPTN','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Informasi mengenai alur pendaftaran peserta Student Day 2019 Fakultas Teknik Universitas Udayana untuk mahasiswa baru jalur SNMPTN dan SBMPTN dapat dilihat selengkapnya pada pamflet.&nbsp;</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1563525518.jpg','2019-07-19 08:38:38','2019-07-19 08:39:25',1),
(20,'Jalur SBMPTN & SNMPTN Serta Bidikmisi yang belum melakukan Registrasi','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Fakultas Teknik Universitas Udayana jalur SNMPTN dan SBMPTN serta Bidikmisi yang belum melakukan registrasi online dan registrasi Student Day tingkat Fakultas dapat melakukan registrasi online dan registrasi Student Day tingkat Fakultas sesuai dengan ketentuan yang telah tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1564901539.jpg','2019-08-04 06:52:19','2019-08-04 06:53:01',1),
(21,'Registrasi Student Day 2019 Jalur Mandiri','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Fakultas Teknik Universitas Udayana jalur Mandiri dapat melakukan registrasi online dan registrasi Student Day tingkat Fakultas dengan ketentuan yang telah tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1564901691.jpg','2019-08-04 06:54:51','2019-08-04 06:54:51',1),
(22,'Alur Pendaftaran Mahasiswa Baru Jalur Mandiri','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Informasi mengenai alur pendaftaran peserta Student Day 2019 Fakultas Teknik Universitas Udayana untuk mahasiswa baru jalur Mandiri dapat dilihat selengkapnya pada pamflet.&nbsp;</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1564901775.jpg','2019-08-04 06:56:15','2019-08-04 06:56:15',1),
(23,'Tanggal, Tempat & Ketentuan Bagi Mahasiswa Baru Jalur SNMPTN dan SBMPTN serta Bidikmisi yang belum melakukan registrasi Student Day','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Jalur SNMPTN dan SBMPTN serta Bidikmisi Fakultas Teknik yang belum melakukan registrasi Student Day tingkat Fakultas dapat melakukan Registrasi Student Day tingkat Fakultas bertempat di Kampus Teknik Sipil Bukit Jimbaran sesuai dengan waktu dan ketentuan yang tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1564974737.jpg','2019-08-05 03:12:17','2019-08-05 03:12:17',1),
(24,'Tanggal, Tempat & Ketentuan Bagi Mahasiswa Baru Jalur Mandiri','<p>[ PENGUMUMAN ]</p>\r\n\r\n<p>Bagi Mahasiswa Baru Jalur Mandiri Fakultas Teknik Universitas Udayana dapat melakukan Registrasi Student Day tingkat Fakultas bertempat di Kampus Teknik Sipil Bukit Jimbaran sesuai dengan waktu dan ketentuan yang tertera pada pamflet.</p>\r\n\r\n<p>#HIDUPTEKNIK!!!</p>\r\n','1564974774.jpg','2019-08-05 03:12:54','2019-08-05 03:12:54',1);
